import React from "react";

const SignupForm = () => {
  return (
    <>
      <div className="header">
        <h3>Login</h3>
        <h3>Register</h3>
      </div>
      <div>{/* <input>place_holder</input> */}</div>
      <div>
        <h1>Signup Here</h1>
      </div>
    </>
  );
};

export default SignupForm;
